import './App.css';
import bg from './img/main-bg.jpg';
import {Navigation, NavDropDown, Nav, Container, Navbar} from 'react-bootstrap';
import { useEffect } from 'react';

function App() {
  useEffect(()=>{
    document.getElementById('bg').style.backgroundImage = `url('${bg}')`;
  });
  return (
    <div className="" id='bg' style={{height: '400px', backgroundSize: 'cover'}}>
      <header className="custom">
        <Navbar>
          <Navbar.Brand href='#'>Cozy House</Navbar.Brand>
        </Navbar>
      </header>
    </div>
  );
}

export default App;
